import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import { HomeScreen } from '../screens/dashboard/HomeScreen';
import { AddTransactionScreen } from '../screens/dashboard/AddTransactionScreen';
import { CreatePocketScreen } from '../screens/dashboard/CreatePocketScreen';
import { TransactionsScreen } from '../screens/dashboard/TransactionsScreen';
import { TransactionDetailScreen } from '../screens/dashboard/TransactionDetailScreen';
import { PocketsScreen } from '../screens/dashboard/PocketsScreen';
import { PocketDetailScreen } from '../screens/dashboard/PocketDetailScreen';

export type MainStackParamList = {
  Home: undefined;
  AddTransaction: { pocketId?: number } | undefined;
  CreatePocket: undefined;
  Transactions: undefined;
  TransactionDetail: { id: number };
  EditTransaction: { id: number };
  Pockets: undefined;
  PocketDetail: { id: number };
};

const Stack = createStackNavigator<MainStackParamList>();

export const MainNavigator = () => {
  return (
    <Stack.Navigator
      screenOptions={{
        headerStyle: {
          backgroundColor: '#007AFF',
          elevation: 0,
        },
        headerTintColor: '#ffffff',
        headerTitleStyle: {
          fontWeight: 'bold',
        },
      }}
    >
      <Stack.Screen
        name="Home"
        component={HomeScreen}
        options={{
          title: 'PocketPilot',
          headerLeft: () => null, // Disable back button on home screen
        }}
      />
      <Stack.Screen
        name="AddTransaction"
        component={AddTransactionScreen}
        options={{
          title: 'Add Transaction',
          presentation: 'modal',
          headerStyle: {
            backgroundColor: '#ffffff',
          },
          headerTintColor: '#007AFF',
          headerShadowVisible: false,
        }}
      />
      <Stack.Screen
        name="CreatePocket"
        component={CreatePocketScreen}
        options={{
          title: 'Create Pocket',
          presentation: 'modal',
          headerStyle: {
            backgroundColor: '#ffffff',
          },
          headerTintColor: '#007AFF',
          headerShadowVisible: false,
        }}
      />
      <Stack.Screen
        name="Transactions"
        component={TransactionsScreen}
        options={{
          title: 'Transactions',
          headerStyle: {
            backgroundColor: '#ffffff',
          },
          headerTintColor: '#007AFF',
          headerShadowVisible: false,
        }}
      />
      <Stack.Screen
        name="TransactionDetail"
        component={TransactionDetailScreen}
        options={{
          title: 'Transaction Details',
          headerStyle: {
            backgroundColor: '#ffffff',
          },
          headerTintColor: '#007AFF',
          headerShadowVisible: false,
        }}
      />
      <Stack.Screen
        name="Pockets"
        component={PocketsScreen}
        options={{
          title: 'My Pockets',
          headerStyle: {
            backgroundColor: '#ffffff',
          },
          headerTintColor: '#007AFF',
          headerShadowVisible: false,
        }}
      />
      <Stack.Screen
        name="PocketDetail"
        component={PocketDetailScreen}
        options={({ route }) => ({
          title: 'Pocket Details',
          headerStyle: {
            backgroundColor: '#007AFF',
          },
          headerTintColor: '#ffffff',
        })}
      />
      {/* TODO: Add EditTransaction screen when implemented */}
    </Stack.Navigator>
  );
};
